is_package: false
container:
  type: HtmlTemplate
  properties: {html: '@theme:standard-page.html'}
  event_bindings: {}
components:
- type: ColumnPanel
  properties: {}
  name: root
  layout_properties: {slot: default}
- type: FlowPanel
  properties: {}
  name: navbar
  layout_properties: {slot: nav-right}
  components:
  - type: Button
    properties: {role: secondary-color, align: center, tooltip: '', border: '', enabled: true,
      foreground: '', visible: true, text: SIGN UP / IN, font_size: null, font: '',
      spacing_above: small, icon_align: left, spacing_below: small, italic: false,
      background: '', bold: false, underline: false, icon: ''}
    name: signInButton
    layout_properties: {}
    event_bindings: {click: onSignInClick}
- type: ColumnPanel
  properties: {col_widths: '{}'}
  name: sidebar
  layout_properties: {slot: left-nav}
  components:
  - type: Link
    properties: {role: null, url: '', align: left, tooltip: '', border: '', foreground: '',
      visible: true, text: Simulation Controls, font_size: null, wrap_on: mobile,
      font: '', col_spacing: medium, spacing_above: small, icon_align: left, col_widths: '',
      spacing_below: small, italic: false, background: '', bold: false, underline: false,
      icon: ''}
    name: simulationControlsLink
    layout_properties: {grid_position: 'LBMOVW,BTHRAP'}
    event_bindings: {click: onSimulationControlsLinkClick}
  - type: Link
    properties: {role: null, url: '', align: left, tooltip: '', border: '', foreground: '',
      visible: true, text: Run Simulation, font_size: null, wrap_on: mobile, font: '',
      col_spacing: medium, spacing_above: small, icon_align: left, col_widths: '',
      spacing_below: small, italic: false, background: '', bold: false, underline: false,
      icon: ''}
    name: runSimulationLink
    layout_properties: {grid_position: 'CTDROU,HNGBTW'}
    event_bindings: {click: onRunSimulationLinkClick}
  event_bindings: {}
- type: FlowPanel
  properties: {}
  name: titlebarFlowPanel
  layout_properties: {slot: title}
  components:
  - type: Image
    properties: {role: null, vertical_align: center, height: '45', tooltip: '', border: '',
      foreground: '', visible: true, display_mode: shrink_to_fit, spacing_above: small,
      source: 'data:image/png;base64,',
      spacing_below: small, background: '', horizontal_align: center}
    name: logo
    layout_properties: {slot: default}
  - type: Label
    properties: {role: null, align: left, tooltip: '', border: '', foreground: '',
      visible: true, text: SimAID, font_size: null, font: '', spacing_above: small,
      icon_align: left, spacing_below: small, italic: false, background: '', bold: false,
      underline: false, icon: ''}
    name: title
    layout_properties: {}
